import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Connection from './blockchain/connection';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import FirstPage from './components/pages/FirstPage';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <Router>
    <Routes>
        <Route exact path="/" element={<FirstPage />} />
        <Route path="/connect" element={<Connection />} />
        <Route path="/connect" element={<Navigate to="/connect/all"/>} />
        <Route path="/connect/all" element={<All block_list={block_list}/>} />
        <Route path="/connect/cctv" element={<CCTV/>} />
        <Route path="/connect/documents" element={<Documents/>} />
        <Route path="/connect/checklist" element={<CheckList/>} />
        <Route path="/connect/temp" element={<Temp/>} />
        <Route path="/connect/pressure" element={<Pressure/>} />
        <Route path="/connect/ray" element={<Ray/>} />
        <Route path="/connect/writetransaction" element={<WriteTransaction transactionInstance={transactionInstance} account={account} />}/>
    </Routes>
  </Router>
);
